INSERT INTO `currency_types_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(3319, 'deDE', 'Insigne der Zwielichtklinge', 'Wird den Mitgliedern des Kults der Zwielichtklinge im Rahmen ihrer Initiation gegeben. Händler im Basislager für den Aufstieg im Schattenhochland akzeptieren es als Beweis für Eure Bemühungen, die Aktivitäten des Kults zu unterbinden.', 65727),
(3356, 'deDE', 'Unbesudelte Manakristalle', 'Kann verdient werden, nachdem Ihr Stufe 9 der Reise des Tiefenforschers erreicht habt. Kann durch das Öffnen von großzügigen Kästen mit restaurierten Kastenschlüsseln in großzügigen Tiefen der Stufe 11 erhalten werden. Kann bei Zah\'ran gegen mächtige Ausrüstung eingetauscht werden.', 65727),
(2803, 'deDE', 'Lorenmünze', 'Eine Währung, die oft von Entdeckern verwendet wird, um Geheimnisse und Erzählungen von Wert zu tauschen.', 65727);
