(2801, 'deDE', 'Herz der Dunkelheit', 'Kämpft Euch zum Kern der Manaschmiede Omega vor und stellt Euch der fleischgewordenen Dunkelheit: Dimensius dem alles Verschlingenden.', 65727),
(2800, 'deDE', 'Monster im Sand', 'Unterbindet den Versuch von Schmiedeweber Araz, Dimensius zu beschwören und in die tödlichen Sande unter dem Schatten der Manaschmiede Omega zu flüchten.', 65727),
(2799, 'deDE', 'Macht der Schattenwache', 'Erlangt Zugang zum Herz der Manaschmiede Omega und haltet die Machenschaften der Schattenwache auf.', 65727),
