(2783, 'deDE', 'Der Chromkönig', 'Konfrontiert Chromkönig Gallywix in seinem Geheimlabor, wo er bereits mit seiner bisher tödlichsten Erfindung wartet.', 65727),
(2782, 'deDE', 'Zwei Köpfe sind besser', 'Niemand gelangt zu Chromkönig Gallywix, ohne zuerst an Mug\'Zee vorbeizukommen.', 65727),
(2781, 'deDE', 'Manischer Maschinist', 'Stix Kojenschrotter ist der Meister des Schrottplatzes, wo er des einen Goblins Müll in eines anderen Goblins Massenvernichtungswaffen verwandelt.', 65727),
(2780, 'deDE', 'Schockschwerenot', 'Mindert die Lärmbelastung und befreit Lorenhall von Rik Resonanz\' Einfluss.', 65727),
