(2713, 'deDE', 'Schicksal von Amirdrassil', 'Fyrakk hat das Herz von Amirdrassil erreicht und droht, sich seine Macht anzueignen.', 65727),
(2712, 'deDE', 'Das Viridiangewebe', 'Nymue webt die hypnotischen Muster des Smaragdgrünen Traums. Unser Eindringen hat das Geflecht gestört, und das wird Konsequenzen haben.', 65727),
(2711, 'deDE', 'Geschmolzene Invasion', 'Larodar, verderbt durch die Flamme, will den Smaragdgrünen Traum mit Feuer überziehen. Wenn er Erfolg hat, wird alles zu Asche verbrennen.', 65727),
(2710, 'deDE', 'Schneise der Inkarnation', 'Glimmeron hat sich einen Weg in den Smaragdgrünen Traum gebahnt. Wenn er nicht aufgehalten wird, werden seine Streitkräfte alles niederbrennen, was ihnen im Weg steht.', 65727),
(2709, 'deDE', 'Grenze der Leere', 'Sarkareth steht am Rand des Abgrunds und versucht, sich Neltharions Macht zunutze zu machen und das Vermächtnis des ehemaligen Erdwächters an sich zu reißen.', 65727),
(2708, 'deDE', 'Neltharions Schatten', 'Etwas regt sich in der Dunkelheit... Es hat einst den Erdwächter korrumpiert und dürstet jetzt nach neuen Opfern.', 65727),
(2707, 'deDE', 'Riesenzorn', 'Die Kriegsmeute der Zaqali hat einen verheerenden Angriff auf den Schmelztiegel gestartet, um alles in ihrem Weg zu zerstören.', 65727),
(2706, 'deDE', 'Zorn des Sturms', 'Raszageth ist erzürnt und droht, das Gefängnis ihrer Geschwister zu zerstören. Sollte ihr das gelingen, werden die Inkarnationen ganz Azeroth verwüsten.', 65727),
(2705, 'deDE', 'Höhlen der Infusion', 'Kurog Grimmtotem bereitet die Entfesselung monströser Elementare vor, um die Vernichtung aller herbeizuführen, die sich ihm widersetzen.', 65727),
(2704, 'deDE', 'Verworfene Arbeiten', 'Jahrtausende der Vernachlässigung haben Neltharions Schöpfungen in etwas Monströses verwandelt.', 65727),
(2703, 'deDE', 'Das Primalistenbollwerk', 'Der Primalistenrat verstärkt seine Verteidigung im Inneren des Berges. Seine Reihen müssen durchbrochen werden, um die Befreiung der Inkarnationen zu verhindern.', 65727),
