(2650, 'deDE', 'Geheimnisse des Palastes der Nerub\'ar', 'Sikran führt die nerubischen Streitkräfte mit taktischem Geschick und Präzision an und beseitigt alle Eindringlinge, die die Königin entthronen wollen.', 65727),
(2649, 'deDE', 'Die huschenden Festungsmauern', 'Monströse und edle Wächter schützen die schwärenden Gruben und hängenden Festungsmauern, die den Palast der Nerub\'ar umgeben.', 65727),
