(2402, 'deDE', 'Grenze der Leere', 'Sarkareth steht am Rand des Abgrunds und versucht, sich Neltharions Macht zunutze zu machen und das Vermächtnis des ehemaligen Erdwächters an sich zu reißen.', 65727),
(2401, 'deDE', 'Neltharions Schatten', 'Etwas regt sich in der Dunkelheit... Es hat einst den Erdwächter korrumpiert und dürstet jetzt nach neuen Opfern.', 65727),
(2400, 'deDE', 'Riesenzorn', 'Die Kriegsmeute der Zaqali hat einen verheerenden Angriff auf den Schmelztiegel gestartet, um alles in ihrem Weg zu zerstören.', 65727),
(2399, 'deDE', 'Verworfene Arbeiten', 'Jahrtausende der Vernachlässigung haben Neltharions Schöpfungen in etwas Monströses verwandelt.', 65727),
(2382, 'deDE', 'Hallen der Infusion', '', 65727),
(2381, 'deDE', 'Hallen der Infusion', '', 65727),
(2380, 'deDE', 'Brackenfellhöhle', '', 65727),
(2379, 'deDE', 'Brackenfellhöhle', '', 65727),
(2378, 'deDE', 'Angriff der Nokhud', '', 65727),
(2377, 'deDE', 'Angriff der Nokhud', '', 65727),
(2376, 'deDE', 'Rubinlebensbecken', '', 65727),
(2375, 'deDE', 'Rubinlebensbecken', '', 65727),
(2372, 'deDE', 'Zorn des Sturms', 'Raszageth ist erzürnt und droht, das Gefängnis ihrer Geschwister zu zerstören. Sollte ihr das gelingen, werden die Inkarnationen ganz Azeroth verwüsten.', 65727),
(2371, 'deDE', 'Höhlen der Infusion', 'Kurog Grimmtotem bereitet die Entfesselung monströser Elementare vor, um die Vernichtung aller herbeizuführen, die sich ihm widersetzen.', 65727),
(2370, 'deDE', 'Das Primalistenbollwerk', 'Der Primalistenrat verstärkt seine Verteidigung im Inneren des Berges. Seine Reihen müssen durchbrochen werden, um die Befreiung der Inkarnationen zu verhindern.', 65727),
(2358, 'deDE', 'Neltharus', '', 65727),
(2354, 'deDE', 'Uldaman: Vermächtnis von Tyr', '', 65727),
(2352, 'deDE', 'Uldaman: Vermächtnis von Tyr', '', 65727),
(2348, 'deDE', 'Der Große Entwurf', 'Der Kerkermeister steht kurz vor dem endgültigen Sieg. Wenn er nicht aufgehalten wird, erliegt der gesamte Kosmos seiner Macht.', 65727),
(2347, 'deDE', 'Griff der Herrschaft', 'Zovaals mächtigste Anhänger haben Millionen von Zivilisationen zerstört. Werden sie jetzt das Universum auslöschen?', 65727),
(2346, 'deDE', 'Ephemere Ebenen', 'Die Essenz der Schöpfung wird verschlungen. Wenn dem nicht Einhalt geboten wird, wird die Realität sich auflösen.', 65727),
(2345, 'deDE', 'Grundstein der Schöpfung', 'Lihuvim kämpft vergeblich gegen die Herrschaft an. Wenn er nicht gerettet wird, fällt die Macht des Hüters dem Kerkermeister anheim.', 65727),
(2344, 'deDE', 'Die Abrechnung', 'Auf der Turmspitze erwartet Euch Sylvanas Windläufer. Dort wird der entscheidende Kampf um das Schicksal des Kosmos ausgetragen werden.', 65727),
(2343, 'deDE', 'Fesseln des Schicksals', 'Der Seelenfluss endet an der Spitze des Turms. Vernichtet jene, die von ihm zehren, um die unzähligen Seelen zu befreien, denen das Leben nach dem Tode verwehrt wird.', 65727),
(2342, 'deDE', 'Die Dunkle Bastille', 'Die Schreie der Gequälten treiben die Armee des Kerkermeisters an. Bereitet ihrem Leiden ein Ende und beraubt den Schlund seiner wertvollsten Ressource.', 65727),
(2341, 'deDE', 'Frontkämpfer des Kerkermeisters', 'Die Frontkämpfer des Kerkermeisters stehen bereit, um jeden Angriff abzuwehren. Um in das Sanktum des Kerkermeisters zu gelangen, müssen ihre Linien durchbrochen werden.', 65727),
(2340, 'deDE', 'Eine Audienz mit der Arroganz', 'Denathrius erwartet die Helden ungeduldig in seinem Turm, um in einem letzten Aufeinandertreffen endgültig über das Schicksal von Revendreth zu entscheiden.', 65727),
(2339, 'deDE', 'Blut aus Stein', 'Denathrius\' Generäle der Steinlegion bereiten im Hinterhalt lauernd eine Falle vor, die die Rebellion ein für alle Mal vernichten wird.', 65727),
(2338, 'deDE', 'Reliquiarium der Opulenz', 'Während die Aristokratie im Siegestaumel schwelgt, müssen Helden ihrer Feier ein Ende setzen und ihre Machtbasis vernichten.', 65727),
(2337, 'deDE', 'Die hungrigen Gewölbe', 'Anima fließt aus den Gewölben von Schloss Nathria wie Blut aus einer offenen Wunde. Dieser Aderlass muss gestoppt werden, bevor Revendreth noch völlig ausblutet.', 65727),
