INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2743, 'deDE', 'Sturmgoldhimmelsross', '|cFFFFD200WoW-Shop|r', 'In Donner gehüllt und vom Schicksal auserkoren. Goldenes Licht umwickelt seine Hufe und durchbricht den Himmel, als würde es die Nacht erhellen. Legenden zufolge soll es eng mit Kaiser Shaohao in Verbindung stehen.', 65727),
(2742, 'deDE', 'Donnerhufhimmelsross', '|cFFFFD200WoW-Shop|r', 'Nach dem Fall des Donnerkönigs hat sich sein verweilendes Donnern mit dem Geist eines weißen Drachen vereint. Er schreitet auf azurblauen Blitzen und hinterlässt wirbelnde Wolken hinter sich. Wo einst Tyrannei herrschte, besteht nun nur noch das Licht eines Wächters.', 65727),
(2798, 'deDE', 'Bronzene Grabschwinge', '|cFFFFD200Erfolg: |rMeister der turbulenten Zeitwege IV|n|cFFFFD200Kategorie: |rZeitwanderung|n', 'Auch wenn die bevorzugte Ästhetik der Bewohner von Revendreth eher düster und ominös ist, gibt es doch noch einige, die strahlenden Glanz bevorzugen.', 65727),
(2797, 'deDE', 'Bronzene Leichenfliege', '|cFFFFD200Erfolg: |rMeister der turbulenten Zeitwege IV|n|cFFFFD200Kategorie: |rZeitwanderung', 'Es kostet einiges an Mühe, eine Leichenfliege zu schmücken, doch manch einer würde sagen, dass es das wert ist.', 65727),
(2796, 'deDE', 'Bronzeaquilon', '|cFFFFD200Erfolg: |rMeister der turbulenten Zeitwege IV|n|cFFFFD200Kategorie: |rZeitwanderung|n|n', 'Die verlässlichen Rösser der Bastion sollen die stolzen und edlen Krieger der Aufgestiegenen widerspiegeln.', 65727),
(2795, 'deDE', 'Bronzewildling', '|cFFFFD200Erfolg: |rMeister der turbulenten Zeitwege IV|n|cFFFFD200Kategorie: |rZeitwanderung|n|n', 'Die majestätischen Wildlinge winden sich durch die Lüfte, frei wie die ungebundenen Magien, die sie in der Luft halten.', 65727),
(1729, 'deDE', 'Größter Schleimer der Stadt', '|cFFFFD200Quest:|r Auf den Schleim gegangen|n|cFFFFD200Zone: |rZaralekhöhle', 'Großes Herz, große Träume, großer Schleimer.', 65727);
